ABIs=[abi_cbETH,abi_RPL,abi_frxETH,abi_SWISE,abi_stETH,abi_ANKR,abi_SD,abi_rETH,abi_sETH2]

def get_token_supply(Contract_Address,abi,block_number):
    contract_function = w3.eth.contract(address=Contract_Address, abi=abi)
    total_supply = contract_function.functions.totalSupply().call(block_identifier=block_number)
    return total_supply

#循环获取Contract_Address的历史总发行量
for k,v in tqdm(LSTs.items()):
    Contract_Address=w3.to_checksum_address(k)
    print(Contract_Address,v['symbol'])
    index = list(LSTs.keys()).index(k)
    abi=ABIs[index]
    header = ["block_number", "total_supply"]
    with open(f'/srv/abacus-1/Uniswap_data/total_supply_LSD_by_block/total_LSD_supply_{v["symbol"]}.csv', mode='a', newline='') as file:
        writer = csv.writer(file)
        # 检查文件是否为空，如果为空则写入表头
        if file.tell() == 0:
            writer.writerow(header)
        for j in tqdm(range(int(v['created_number']), 17100000,1000)):
            #获取 total_supply,并存储为csv,csv 增加表头block_number 和 total_supply
            total_supply = get_token_supply(Contract_Address,abi,j)
            writer.writerow([j, total_supply])

